sys_variable_value.value:
(function execute(inputs, outputs) {
try {
    var assignmentOption = '';
   var assignmentGroup = '';
   var subflowName = 'x_885373_event_tes.'
   var flowDetails = new GlideRecord('x_885373_event_tes_custom_subflow_rules');
   flowDetails.addQuery('alert_management_rule.sys_id', inputs.alertRuleId);
   flowDetails.query();
    if(flowDetails.next()){
      if(inputs.priority == 1){
        assignmentOption = flowDetails.u_p1_assignment_options;
        if(assignmentOption == 'specific group'){
            outputs['assignment_group'] = flowDetails.u_specific_p1_assignment_group.sys_id;
        }else if(assignmentOption == 'reference group'){
            assignmentGroup = flowDetails.u_p1_assignment_group;
            outputs['assignment_group'] = getAssignmentGroup(assignmentGroup);
        }else if(assignmentOption == 'subflow'){
          assignmentGroup = subflowName + flowDetails.u_p1_subflow_assignment.internal_name;
            startAssignmentSubflow(assignmentGroup);
        }
   }else if(inputs.priority == 2){
        assignmentOption = flowDetails.u_p2_assignment_options;
              if(assignmentOption == 'specific group'){
            outputs['assignment_group'] = flowDetails.u_specific_p2_assignment_group.sys_id;
        }else if(assignmentOption == 'reference group'){
            assignmentGroup = flowDetails.u_p2_assignment_group;
            outputs['assignment_group'] = getAssignmentGroup(assignmentGroup);
        }else if(assignmentOption == 'subflow'){
          assignmentGroup = subflowName + flowDetails.u_p2_subflow_assignment.internal_name;
            startAssignmentSubflow(assignmentGroup);
            
        }
   }else if(inputs.priority == 3){
        assignmentOption = flowDetails.u_p3_assignment_options;
              if(assignmentOption == 'specific group'){
            outputs['assignment_group'] = flowDetails.u_specific_p3_assignment_group.sys_id;
        }else if(assignmentOption == 'reference group'){
            assignmentGroup = flowDetails.u_p3_assignment_group;
            outputs['assignment_group'] = getAssignmentGroup(assignmentGroup);
        }else if(assignmentOption == 'subflow'){
          assignmentGroup = subflowName + flowDetails.u_p3_subflow_assignment.internal_name;
          gs.info(assignmentGroup);
            startAssignmentSubflow(assignmentGroup);
            
        }
     }
   }		
  } catch (ex) {
    var message = ex.getMessage();
    gs.error(message);
  }

  	function getAssignmentGroup(assignmentGroup){
      assignmentGroup.split(/[${}]/).forEach(function(item) {
        var alertGR = inputs.alertGR;
        var placeholder = '${' + item + '}';
        if (item && assignmentGroup.includes(placeholder)) {
            var element = alertGR.getElement(item);
            if (element) {
                assignmentGroup = assignmentGroup.replace(placeholder, element);
            }
        }
    });
    return assignmentGroup;
    }

    function startAssignmentSubflow(assignmentGroup){
      var flowInputs = {};
    flowInputs['alertgr'] = inputs.alertGR;
    flowInputs['priority'] = inputs.priority;
    flowInputs['alertruleid'] = inputs.alertRuleId; 
   
      var output = sn_fd.FlowAPI.executeSubflow(assignmentGroup, flowInputs);
outputs['assignment_group'] = output['assignment_group'];
    }
})(inputs, outputs);

